-- [[ LOGIKA JALAN (JANGAN DIUBAH) ]]
local function JalanKe(targetCF)
    if not HRP then return end
    
    -- Hitung jarak untuk menentukan waktu tempuh (agar speed konsisten)
    local Jarak = (HRP.Position - targetCF.Position).Magnitude
    local Waktu = Jarak / Kecepatan
    
    -- Membuat animasi jalan (Tween)
    local Info = TweenInfo.new(Waktu, Enum.EasingStyle.Linear)
    local Animasi = TweenService:Create(HRP, Info, {CFrame = targetCF})
    
    -- Agar karakter melayang sedikit & tidak jatuh (Noclip/Anchor sementara)
    local OldState = HRP.Anchored
    HRP.Anchored = true 
    
    Animasi:Play()
    Animasi.Completed:Wait() -- Tunggu sampai sampai di titik tujuan
    
    HRP.Anchored = OldState -- Kembalikan kondisi semula
end

-- EKSEKUSI
for i, titik in ipairs(Checkpoints) do
    -- Kirim notifikasi kecil di layar (bukan GUI)
    game:GetService("StarterGui"):SetCore("SendNotification", {
        Title = "Auto Walk",
        Text = "Menuju Titik: " .. i,
        Duration = 1
    })
    JalanKe(titik)
    task.wait(0.1) -- Istirahat sebentar sebelum ke titik berikutnya
end
